Siwalan ("Borassus flabellifer", uga diarani wit tal) iku jinising palma sing urip ing Asia Kidul lan Asia Tenggara. Déné godhong wit gebang/tal iki akèh pigunané lan diarani "ron tal". "Ron" tegesé godhong. Saka kléra-klèruné pangucap, banjur salin swara dadi "lontar". Wit iki mligi thukul ing panggonan sing garing. Ing Indonésia, siwalan mligi thukul ing sisih wétan pulo Jawa, Madura, Bali, Nusa Tenggara Kulon lan Nusa Tenggara Wétan.
Pigunané.
Godhongé kagunakaké kanggo barang kerajinan lan uga kanggo bahan panulisan naskah rontal. Bahan-bahan kerajinan sing digawé saka godhong siwalan antarané kipas, klasa, lan sasando.
Wohé uga bisa dipangan. Woh siwalan kang isih enom bisa didadekaké minangka obat, kaya ta obat kanggo lelara empedu lan disèntri. Sajroning woh siwalan kinandhut manéka vitamin kang murakabi tumraping awak, ing antarané yaiku vitamin b, vitamin c, zat besi, zinc, fosfor, kalium, tiamin, lan riboflavin. 
Banyuné (sing sajatiné endosperma cair) bisa difermentasi dadi tuwak lan ingaran legèn ing basa Jawa.

