Gong iku piranti gamelan Jawa kang ditabuh, digawé saka tosan lan nduwé ukuran kang gedhé dhéwé. Piranti iki racaké papané ing mburi dhéwé, digantung ing palangan gayor kang umum digawé saka kayu ukuran gedhé. Ana loro jinis gong yaiku: gong ageng lan gong suwuk. Saben laras sléndro lan pelog duwé telung sèt gong. Gong Gedhé kang cacahé loro lan siji gong suwukan
Wujud.
Wujudé bunder, gedhé, rada cekung, kanthi garis tengah 1 méter, lan permukaané rata ning ana tonjolan ing tengah-tengah.
Swara.
Gong nduwé swara kang gedhé dhéwé lan nadhané paling asor tinimbang nadha piranti gamelan liyané, yaiku kanthi nadha 3(telu)
Fungsi.
Gong ditabuh kanggo awèh tekanan ing pérangan tinentu (lumrahé akir) iringan musik gamelan utawa dadi pratandha pungkasé sawijining tembang lan gérong dadi arang banget ditabuh (ora terus-terusan) ning ditabuh ing selang wektu tinentu.
Prangkat musik tradhisional iki saiki nduwé fungsi liya yaiki kanggo tandha paresmian utawa pambuka acara.
