Bupati iku pamimpin kabupatèn. Tembung "bupati" iki saka basa Sansekerta: "bhûpati", "raja dunya"). Pilungguhan Bupati sejajar karo Walikutha. Kanggo nglakokaké papréntahan, bupati nduwé jejibahan lan wewenang mimpin giyaran kabupatèn miturut kawicaksanan sing wis kukuhaké bareng karo DPRD Kabupatèn.&lt;br&gt;
Sadurungé taun 1945 kalungguhan bupati iki mung ing Pulo Jawa, Madura lan sawatara Bali. Sabubaré taun 1945 digunaake ing kabèh kabupatèn sa-Indonésia.
Pamilihan.
Bupati dipilih bareng karo pasangane (wakil bupati) sepaket lan langsung dipilih déning rakyat sekabupatèn. Jabatan bupati iki kalungguhan politis amarga diusulake parté pulitik lan ora kalebu punggawa nagari sipil.

